window.bookSummaryJSON = "<p><b>Once, they stood </b><b><i>next</i></b><b> to justice. Now they're standing </b><b><i>up</i></b><b> for it...</b></p> <p>When sworn protectors of Earth, the Justice Platoon, are all horribly killed, their former arch-enemies come crawling out of the woodwork. Outnumbered, outgunned, and out of options, the US government has no choice but to activate <i>the Sidekicks Initiative</i>, dragging the Platoon's middle-aged ex-sidekicks out of retirement.</p> <p>Now these three reluctant, out of shape former child-wonders must work together to stop the rising tide of supervillainy, avenge their former mentors' deaths, and bring the world back from the brink of destruction.&nbsp;</p> <p>Assuming they don't kill each other first.</p> <p><b>Featuring anaphylactic shockwaves, unexpected hippos, and an aggressive man shouting at butterflies, </b><b><i>The Sidekicks Initiative</i></b><b> is the first book in the action-packed new series from internationally best-selling </b><b><i>Space Team</i></b><b> author, Barry J. Hutchison.</b></p>"; 
